import React from "react";
import '../css/final.css'

const Final = (goToLogProv, goToLogCom) => {
    return (
      <div className='Final'>
        <div className="cuerpo">
         <h1>Haz creado tu perfil</h1>
         <h2>Gracias por formar parte de alliance</h2>
         <h3>Encontraras una comunidad en la que podra mostrase y aprovechar la informacion y contactos para su negocio</h3>
         <div className=''>
           <button onClick={goToLogProv} className='' >Ir al perfil</button>
         </div>
        </div>
      </div>
    );
}
export default Final;
